import { Row, Col } from "reactstrap";
import { Redirect } from "react-router-dom";

const Login = (props) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [volver, setVolver] = useState(false);

  function login(e) {
    e.preventDefault();

    props.login({
      email,
      password,
    });

    setVolver(true);
  }

  function cancelar() {
    setVolver(true);
  }

  if (volver === true) {
    return <Redirect to="/" />;
  }

